// jshint strict: false
// +------------------------------------------------------------------------------------+
// | Mesmo o script funcionando é exibido um aviso de:                                  |
// | too many erros                                                                     |
// | A linha acima exclui o aviso de erro                                               |
// | https://forum.processing.org/two/discussion/15717/alert-too-many-erros-xx-scanned  |
// +------------------------------------------------------------------------------------+

// +--------------------------------------------------------------------+
// | CRIADO em 06/05/2021                                               |
// | Programa gerador da ELIPSE SVG na máquina WEB                      |
// | /srv/www/cgi-bin/Opgdr/Topologia/GeraElipseDinamicaSVG.pl          |
// |                                                                    |
// | Caso efetue alterações nos raios da ELIPSE, alterar aqui também    |
// +--------------------------------------------------------------------+

// +--------------------------------------------------------------------+
// | SCRIPT de atualização rodando na máquina 81                        |
// | /srv/www/cgi-bin/snmp/modelo/update_MODELO_ELIPSE.pl MODELO                 |
// | /usr/lib64/perl5/UpdateElipse.pm                                   |
// +--------------------------------------------------------------------+

// +--------------------------------------------------------------------+
// | SCRIPT de atualizacao:                                             |
// | Criterios :                                                        |
// | status = 1 && (rx = 0 || tx = 0) ==> NORMAL (Tabela de uint é INT) |
// +--------------------------------------------------------------------+

var pontosAtual = 0; var nome = {}; var host = {}; var sentidorx = {}; var percrx = {};
var sentidotx = {}; var perctx = {}; var regional; var stat = {}; var circuito = {}; var iface = {};
var total = 1; var cliente; var uf; var ri = {}; var evento = {};
var hostmanutencao = {};

var stroke = 0; var pisca = 0; var color;

ctrl.data.forEach((item) => {

    let valor = item.datapoints.map((d) => d[0]);

    // +----------------------------------------------------+
    // | CONSULTA A => Total de pontos da UF                |
    // +----------------------------------------------------+
    if (item.alias == "TOTAL") {
        total = valor; 
    }
    
    // +----------------------------------------------------------------+
    // | CONSULTA B => Traz nome ordenado por nome, interface           |
    // +----------------------------------------------------------------+
    if (item.alias == "DADOS") {
        
        for (let key in valor) {
            
            let info = valor[key].split('__'); 
            
            //let pos = Number(key); 
            nome[key]       = info[0];
            host[key]       = info[1];
            percrx[key]     = info[2];
            perctx[key]     = info[3];
            stat[key]       = info[4];
            
            if (info[5] === 'ACESSO-B') {
                circuito[key]   = info[5].split('-')[0]; 
            
            } else {
                circuito[key]   = info[5];
            }
            iface[key]      = info[6];
            
        }
    }    
    


    // +----------------------------------------------------+
    // | CONSULTA G => Regional                             |
    // +----------------------------------------------------+
    if (item.alias == "REGIONAL") {
        regional = valor; 
        //alert(regional);
    }

    // +----------------------------------------------------------------------+
    // | CONSULTA H => Traz ACESSO ordenado por nome, interface               |
    // +----------------------------------------------------------------------+
    //if (item.alias == "ACESSO") {
    //    for (let key in valor) {
            //let pos = Number(key); 
    //        circuito[key] = valor[key];
            //alert(circuito[key]+"---"+key);
    //    }
    //}

    // +----------------------------------------------------------------------+
    // | CONSULTA I => Traz CLIENTE ordenado por nome, interface               |
    // +----------------------------------------------------------------------+
    //if (item.alias == "CLIENTE") {
            //let pos = Number(key); 
    //        cliente = valor;
            //alert(cliente);
    //}

    // +----------------------------------------------------------------------+
    // | CONSULTA J => Traz UF                                                |
    // +----------------------------------------------------------------------+
    if (item.alias == "UF") {
            //let pos = Number(key); 
            uf = valor;
            //alert(uf);
    }

    if (item.alias == "RI") {
        for (let key in valor) {
            
            let info = valor[key].split('|'); 
            
            for (let i=0;i<info.length;i++) {
                
                if (info[0] !== '') {
                
                    let dados = info[i].split('__');
                
                    if (dados[3].match('RI_')) {
                        ri[dados[0]] = dados[3];
                        evento[dados[0]] = dados[2];
                    
                    } else if (ri[dados[0]] === undefined) {
                        ri[dados[0]] = 'Sem informação RI';
                        evento[dados[0]] = dados[2];
                        
                    }
                }
                
            }
        }        
    }

    if (item.alias == "MANUTENCAO") {
        for (let key in valor) {
        
            let info = valor[key].split('|'); 
            
            for (let i=0;i<info.length;i++) {
                let h = info[i].split('____')[0];
                hostmanutencao[h] = 'Manutenção';
            }    
        }
    }  

});

var svgElement;
var rh = 520; 			                                        // Raio Horizontal da Elipse
var rv = 400;			                                        // Raio Vertical da Elipse
var pi = 3.1415;
var angulo = 0;
var x = 0;
var y = 0;
//var textsize = 9;
var quantidade = 180;

//if (total < 1) { alert("Não foi possível realizar conexão com Banco. Tente mais tarde");}



for (var i=0;i<=quantidade;i++) {
    
    // Esconcendo os objetos
    document.getElementById("Tx"+i).style.display = "none";
    document.getElementById("Rx"+i).style.display = "none";
    document.getElementById("group"+i).style.display = "none";
    document.getElementById("middle"+i).style.display = "none";
}

var href;

for (var w=0;w<total;w++) {

    
    x = rh * Math.cos(angulo) + rh;		        	    // Coordenadas de x e y dos pontos
	y = rv * Math.sin(angulo) + rv;			            // Coordenadas de x e y dos pontos

    //alert(nome[w]+"--"+percrx[w]);

    // Linha TX
    let centroX = (((rh+x))/2);
    let centroY = (((rv+y))/2);

    let situacao;
    
    if (percrx[w] == '-1') { percrx[w] = 0;}
    if (perctx[w] == '-1') { perctx[w] = 0;}
    
    let desc = nome[w] + "\n" + "Circuito: "+circuito[w] +"\n"+ "Interface: " + iface[w] +" \n" + "RX: "+ percrx[w]+"%" + "\n" +  "TX: "+ perctx[w]+"%" ;

    if (hostmanutencao[host[w]] === 'Manutenção') {
        situacao = "Chamado: Localidade em Manutençao";
        desc = desc + "\n" + situacao;
    } else if ( (evento[host[w]] !== undefined) ) {
      // existe evento no zabbix         
        
        //alert(evento[host[w]]+' = = ='+circuito[w])
        // evento contem a interface 
        if (evento[host[w]].match(circuito[w])) {
      
            // força utilizacao 0 para alamar      
            percrx[w] = 0;
            perctx[w] = 0;
            stat[w] = 0;

            situacao = ri[host[w]];
            
            if (circuito[w] === 'WANMAIS') {
                situacao = 'Não abre RI';
            }   
            //desc = desc + "\n" + "Chamado: "+ situacao + "\nFalha: "+ evento[host[w]];
            desc = desc + "\n" + "Chamado: "+ situacao;
        } else if ((ri[host[w]].match('^RI_')) && (evento[host[w]].match('Dispositivo'))) {
            situacao = ri[host[w]];
            desc = desc + "\n" + "Chamado: "+ situacao;
        }    
        
    } 

    if (stat[w] == '1') {
        
        if (percrx[w] == '0') { percrx[w] = 1;}
        if (perctx[w] == '0') { perctx[w] = 1;}

        //alert(circuito[w]+'---'+stat[w]+'---'+perctx[w]+'---'+percrx[w]);
    }
    
    if ((stat[w] == '-1') || (percrx[w] == '-1') || (perctx[w] == '-1')) {
        
        percrx[w] = 0;
        perctx[w] = 0;
        stat[w] = 0;

        //alert()
        //alert(circuito[w]+'---'+stat[w]+'---'+perctx[w]+'---'+percrx[w]+'---'+situacao);
        
        if (situacao === undefined) {
            situacao = 'Sem informação RI';
            //desc = desc + "\n" + "Chamado: "+ situacao + "\nFalha: Não detectada";
            desc = desc + "\n" + "Chamado: "+ situacao;
            //alert(desc)
        }
    }    



    svgElement = document.getElementById("router"+w);
    svgElement.setAttribute("cx",x);
    svgElement.setAttribute("cy",y);
    svgElement.setAttribute("opacity","0.6");    


    //if (hostmanutencao[host[w]] === 'Manutenção') {
    //    desc = desc + "\n" + "Chamado: Localidade em Manutençao";
    //}

    document.getElementById("title"+w).textContent = desc;
    
    svgElement = document.getElementById("middle"+w);
    svgElement.setAttribute("cx",centroX);
    svgElement.setAttribute("cy",centroY);    

    stroke = 0;
    pisca = 0;

    if (percrx[w] > 60) {
        color = "#e02f44";
    } else if (percrx[w] > 45) {
        color="#ff780a";
    } else if (percrx[w] > 15) {
         color="#56a54b";
    } else if (percrx[w] > 0) {
        color="#3274d9";
    } else if (hostmanutencao[host[w]] === 'Manutenção') {
        color="#888888";
        stroke = 10;
        pisca = 0;
        
    } else {
        color="#ffffff";
        stroke = 20;
        pisca = 1;
    }


    // mensagem da RI contem o tipo de circuito (ACESSO-B, WANMAIS, WANMAIS-SERPRO)
    // evita alarmar as duas interfaces se tiver RI para um host
    //if (String(evento[host[w]]).match(circuito[w])) {
    //    color="#ffffff";
    //    stroke = 20;
    //    pisca = 1;
    //}



    svgElement = document.getElementById("Rx"+w);
    svgElement.setAttribute("x1",centroX);
    svgElement.setAttribute("y1",centroY);
    svgElement.setAttribute("x2",rh);
    svgElement.setAttribute("y2",rv);
    svgElement.setAttribute('style', 'stroke: '+color+'; fill: '+color+';stroke-dasharray:'+stroke+';animation: blink '+pisca+'s infinite');    


    stroke = 0;
    pisca = 0;

    if (perctx[w] > 60) {
        color = "#e02f44";
    } else if (perctx[w] > 45) {
        color="#ff780a";
    } else if (perctx[w] > 15) {
         color="#56a54b";
    } else if (perctx[w] > 0) {
        color="#3274d9";
    } else if (hostmanutencao[host[w]] === 'Manutenção') {
        color="#888888";
        stroke = 10;
        pisca = 0;
        
    } else {
        color="#ffffff";
        stroke = 20;
        pisca = 1;
    }


    // mensagem da RI contem o tipo de circuito (ACESSO-B, WANMAIS, WANMAIS-SERPRO)
    // evita alarmar as duas interfaces se tiver RI para um host
    //if (String(evento[host[w]]).match(circuito[w])) {
    //    color="#ffffff";
    //    stroke = 20;
    //    pisca = 1;
    //}


    svgElement = document.getElementById("Tx"+w);
    svgElement.setAttribute("x1",centroX);
    svgElement.setAttribute("y1",centroY);
    svgElement.setAttribute("x2",x);
    svgElement.setAttribute("y2",y);
    svgElement.setAttribute('style', 'stroke: '+color+'; fill: '+color+';stroke-dasharray:'+stroke+';animation: blink '+pisca+'s infinite');    

    svgElement = document.getElementById("text"+w);
    svgElement.setAttribute("x",x);
    y+=5;
    svgElement.setAttribute("y",y);    


    //href = "/d/ResumoIndicadoresPortalMODELO/resumoindicadoresportalmodelo?orgId=1&var-regional="+regional+"&var-localidade="+nome[w]+"&var-circuito="+circuito[w]+"&var-zabbix="+host[w]+"&var-uf="+uf+"&var-interface="+iface[w];
    href = "/d/ResumoIndicadoresPortalMODELO/resumoindicadoresportalmodelo?orgId=1&var-localidade="+nome[w]+"&var-circuito="+circuito[w]+"&var-zabbix="+host[w]+"&var-uf="+uf+"&var-interface="+iface[w];
    svgElement = document.getElementById("link"+w);
    svgElement.setAttribute("href",href);
    


    
    document.getElementById("group"+w).style.display = "block";
    document.getElementById("Rx"+w).style.display = "block";
    document.getElementById("Tx"+w).style.display = "block";
    document.getElementById("middle"+w).style.display = "block";
    //document.getElementById("Rx"+w).style.display = "block";

    angulo += ((360/total * pi)/180)*(-1);
    
}
